INSERT INTO `properties` (`property_id`, `propertyname`, `description`, `address`, `cleaningfee`, `extraguest`, `hottub`, `petfee`, `basic_number_of_guest`, `guest_limit`, `slug`, `ics_link`) VALUES
(9, 'Manchester Woods', '<div class=\"_w61jw8\" style=\"line-height: 1.875rem !important; margin-bottom: 32px !important;\"><h2 tabindex=\"-1\" class=\"hpipapi atm_7l_1kw7nm4 atm_c8_1x4eueo atm_cs_1kw7nm4 atm_g3_1kw7nm4 atm_gi_idpfg4 atm_l8_idpfg4 atm_kd_idpfg4_pfnrn2 dir dir-ltr\" style=\"line-height: inherit; outline: 0px;\">About this space</h2><p style=\"line-height: inherit; outline: 0px;\">﻿<br></p><div align=\"justify\"><blockquote tabindex=\"-1\" class=\"hpipapi atm_7l_1kw7nm4 atm_c8_1x4eueo atm_cs_1kw7nm4 atm_g3_1kw7nm4 atm_gi_idpfg4 atm_l8_idpfg4 atm_kd_idpfg4_pfnrn2 dir dir-ltr blockquote\" style=\"line-height: 1.5; outline: 0px;\" align=\"justify\">\"Manchester Woods\" a beautiful VT Mountain retreat just minutes from Manchester, Bromley, Stratton and Magic Mountains.&nbsp; Freshly revamped in June 2022, our spacious home accommodates\r\nup to 16 guests with three queen bedrooms, three inviting gathering rooms, and\r\nthree full baths, each on its own level, making it the perfect haven for large\r\ngroups, multi-generational families seeking quality time together, or companies\r\nlooking for a team-building retreat.&nbsp;\r\n\r\nThe master bedroom, kitchen, dining and living rooms are all accessible from ground floor entry.&nbsp; Steps away from the best hiking in Southern VT!<br></blockquote></div></div><div class=\"_tp3sbt\" style=\"line-height: 1.5rem !important; word-break: break-word !important; margin-bottom: 24px !important;\"><div class=\"_pgfqnw\" style=\"\"><h2 tabindex=\"-1\" class=\"hpipapi atm_7l_1kw7nm4 atm_c8_1x4eueo atm_cs_1kw7nm4 atm_g3_1kw7nm4 atm_gi_idpfg4 atm_l8_idpfg4 atm_kd_idpfg4_pfnrn2 dir dir-ltr\" style=\"line-height: inherit; outline: 0px;\">The Space</h2><p style=\"line-height: inherit; outline: 0px;\">﻿<br></p></div><div align=\"justify\"><blockquote align=\"justify\" class=\"blockquote\">Our home is \r\nlocated in the Manchester, Bromley Mtn and Stratton \"triangle\" There are\r\n tons of hiking, fishing and swimming options available within a few \r\nminutes of our home within the Green Mountain State Forest. For our \r\nwinter guests our home is 5 minutes to Bromley Mtn, 17 minutes to \r\nStratton Mtn, 20 Minutes to Magic Mtn, and less than 1 hour to Mt Snow \r\nand Okemo!</blockquote></div></div><div class=\"_tp3sbt\" style=\"line-height: 1.5rem !important; word-break: break-word !important; margin-bottom: 24px !important;\"><div class=\"_pgfqnw\" style=\"\"><h2 tabindex=\"-1\" class=\"hpipapi atm_7l_1kw7nm4 atm_c8_1x4eueo atm_cs_1kw7nm4 atm_g3_1kw7nm4 atm_gi_idpfg4 atm_l8_idpfg4 atm_kd_idpfg4_pfnrn2 dir dir-ltr\" style=\"line-height: inherit; outline: 0px;\">Guest Access</h2><p style=\"line-height: inherit; outline: 0px;\">﻿<br></p></div><div align=\"justify\"><blockquote align=\"justify\" class=\"blockquote\">Guests \r\nhave access to our entire home. If your group wishes to use the brand \r\nnew spa during your stay, there is there is a one time additional charge\r\n of $75 as it needs to be treated between each group that stays at our \r\nhome. The charge is the same whether this day is 2 days or a week. We \r\nwill confirm whether or not our guests want to use this feature after \r\nbooking confirmation to ensure that we have treatments scheduled \r\naccordingly.</blockquote></div></div>', '22 Sylvan Ridge Road, Winhall, Vermont, United States 05340', 285.00, 10.00, 75.00, 55.00, 6, 16, 'manchester-woods', 'http://www.vrbo.com/icalendar/943a294e5fc3417dabd303d813bdbd8e.ics?nonTentative'),
(10, 'Manchester Moose Inn', '<div class=\"_w61jw8\" style=\"line-height: 1.2; margin-bottom: 32px !important;\" align=\"justify\"><h2 tabindex=\"-1\" class=\"hpipapi atm_7l_1kw7nm4 atm_c8_1x4eueo atm_cs_1kw7nm4 atm_g3_1kw7nm4 atm_gi_idpfg4 atm_l8_idpfg4 atm_kd_idpfg4_pfnrn2 dir dir-ltr\" elementtiming=\"LCP-target\" style=\"line-height: 1.2; outline: 0px;\"><span style=\"font-size: 12px;\">﻿</span>About This Space</h2><p style=\"line-height: 1.2; outline: 0px;\">We purchased the Manchester Moose in 2018 and have since remodeled every square inch of it, \r\nwe hope you enjoy staying there as much as we do!  ﻿Bromley-Stratton VT Slopeside Ski Home, Minutes from Manchester, Beautifully remodeled VT vacation getaway nested in the Green Mountains.  Closest skiing to quaint Manchester , VT.  Minutes from snowboarding, hiking, fine dining and shopping.  This home features 5 bedrooms, 3 with queen beds including 2 Masters, recently upgraded two twin over full bunk beds and two twin over twin bunk beds.  Comfortably accommodates 3 families.  Perfect to enjoy any season in Southern Vermont\'s beautiful Green Mountains!<br></p></div><h2 tabindex=\"-1\" class=\"hpipapi atm_7l_1kw7nm4 atm_c8_1x4eueo atm_cs_1kw7nm4 atm_g3_1kw7nm4 atm_gi_idpfg4 atm_l8_idpfg4 atm_kd_idpfg4_pfnrn2 dir dir-ltr\" style=\"line-height: 1.2; outline: 0px;\">Guest Access<br></h2><p class=\"_tp3sbt\" style=\"line-height: 1.2; word-break: break-word !important; margin-bottom: 24px !important;\" align=\"justify\">Guests have \r\naccess to our entire home. If your group wishes to use the built in-ground spa during your stay, there is there is a one time additional \r\ncharge of $75 as it needs to be treated between each group that stays at\r\n our home. The charge is the same whether this day is 2 days or a \r\nweek. We will confirm whether or not our guests want to use this \r\nfeature after booking confirmation to ensure that we have treatments \r\nscheduled accordingly. Please also understand that on rare occasions we \r\nmay need to have a short visit from either firewood delivery company, \r\nproperty manager to mow the lawn in summer, clear the driveway of snow \r\nin winter, etc outside of the house. Inside the house on the lower level\r\n we have a small hot tub room, and access must be granted for our \r\ntechnician to treat the hot tub periodically. They naturally will not \r\naccess any bedrooms or bathrooms, and will be out of your hair as \r\nquickly as possible. Our guests do not need to be home for our \r\ntechnician to access the hot tub room.</p><div class=\"_tp3sbt\" style=\"line-height: 1.2; word-break: break-word !important; margin-bottom: 24px !important;\" align=\"justify\"><div class=\"_tp3sbt\" style=\"line-height: 1.2; word-break: break-word !important; margin-bottom: 24px !important;\"><div class=\"_pgfqnw\" style=\"line-height: 1.2;\"><h2 tabindex=\"-1\" class=\"hpipapi atm_7l_1kw7nm4 atm_c8_1x4eueo atm_cs_1kw7nm4 atm_g3_1kw7nm4 atm_gi_idpfg4 atm_l8_idpfg4 atm_kd_idpfg4_pfnrn2 dir dir-ltr\" style=\"line-height: 1.2; outline: 0px;\">Other Things To Note<br></h2></div><p>Our\r\n home is located in Bromley Village, and we have daily shuttle service \r\nfrom mid December to late March from the house to the base lodge and \r\nback. <b>Our home is lot #1 on the shuttle run.</b></p></div></div>', '871 Ethan Allen Trail, Peru, Vermont, United States 05152', 255.00, 10.00, 75.00, 55.00, 6, 14, 'manchester-moose-inn', 'http://www.vrbo.com/icalendar/b5b0f56f9ed348d19a221b3b3b375ca8.ics?nonTentative'),
(11, 'Summit View Chalet', '<div class=\"_w61jw8\" style=\"line-height: 1.875rem !important; margin-bottom: 32px !important;\" align=\"justify\"><h2 tabindex=\"-1\" class=\"hpipapi atm_7l_1kw7nm4 atm_c8_1x4eueo atm_cs_1kw7nm4 atm_g3_1kw7nm4 atm_gi_idpfg4 atm_l8_idpfg4 atm_kd_idpfg4_pfnrn2 dir dir-ltr\" elementtiming=\"LCP-target\" style=\"line-height: inherit; outline: 0px;\">About this space</h2><p tabindex=\"-1\" class=\"hpipapi atm_7l_1kw7nm4 atm_c8_1x4eueo atm_cs_1kw7nm4 atm_g3_1kw7nm4 atm_gi_idpfg4 atm_l8_idpfg4 atm_kd_idpfg4_pfnrn2 dir dir-ltr\" elementtiming=\"LCP-target\" style=\"line-height: 1.2; outline: 0px;\">Stratton VT Slopeside Ski Home with incredible summit views, Minutes from Manchester, Beautiful newly remodeled VT vacation getaway nestled in the Green Mountains. Relax in the hot tub on the deck with direct summit views in any season. Enjoy shuttle access to lifts, minutes from snowmobiling, hiking, fine dining and shopping. Comfortably accommodates up to 13 guests, with well-stocked\r\nkitchen facilities, this home is perfect for two families looking to create\r\nlasting memories in Southern Vernmont\'s beautiful Green Mountains.\r\n\r\n</p></div><div class=\"_tp3sbt\" style=\"line-height: 1.2; word-break: break-word !important; margin-bottom: 24px !important;\" align=\"justify\"><div class=\"_pgfqnw\" style=\"line-height: 1.2;\"><h2 tabindex=\"-1\" class=\"hpipapi atm_7l_1kw7nm4 atm_c8_1x4eueo atm_cs_1kw7nm4 atm_g3_1kw7nm4 atm_gi_idpfg4 atm_l8_idpfg4 atm_kd_idpfg4_pfnrn2 dir dir-ltr\" elementtiming=\"LCP-target\" style=\"line-height: 1.2;\">The space</h2></div><p style=\"line-height: 1.2;\">This home features 4 bedrooms, 2 with queen beds, 1 with full bed and loft twin above, and 1 bedroom with double bunks. Living room also includes a queen sleeper sofa as well. <br></p></div><div class=\"_tp3sbt\" style=\"line-height: 1.2; word-break: break-word !important; margin-bottom: 24px !important;\" align=\"justify\"><div class=\"_pgfqnw\" style=\"line-height: 1.2;\"><h2 tabindex=\"-1\" class=\"hpipapi atm_7l_1kw7nm4 atm_c8_1x4eueo atm_cs_1kw7nm4 atm_g3_1kw7nm4 atm_gi_idpfg4 atm_l8_idpfg4 atm_kd_idpfg4_pfnrn2 dir dir-ltr\" elementtiming=\"LCP-target\" style=\"line-height: 1.2;\">Other things to note</h2></div><p style=\"line-height: 1.2;\">We have just upgraded our spa in June 2022 and have a service plan now between guests. Please note, if your group is going to use the tub during your stay there is a flat fee of $75 for the treatment needed between guest bookings. Same fee whether the stay is 2 days or a week.&nbsp; <span style=\"font-size: 8px;\">﻿</span><span style=\"font-size: 14px;\">﻿</span><br>Our home is located on the last stop of the Blue Shuttle Line at Stratton, and picks up 5 minutes before the hour and drops off at base lodge on the hour starting at 7:55AM to 11:55AM on Saturdays/Sundays and Holidays weeks. There are no shuttles during the weekdays except for Xmas and Presidents Day week.</p></div>', '34 Mountain View Road, Winhall, Vermont, United States 05340', 225.00, 10.00, 75.00, 55.00, 6, 13, 'summit-view-chalet', 'http://www.vrbo.com/icalendar/2e482605ea3247a8ae056b63839ca712.ics?nonTentative');
